import React, { useState } from 'react';
import Administrar from './Administrar';
import Botones from './Botones';

const ListadoTareas = () => {

  //state para tener el nombre de la tarea que elegimos
  //con el boton que presionamos y pasarlo al return
  const [tarea, guardarTarea] = useState({
    nombre: ''
  });

  const eleccionTarea = '';

  switch(tarea.nombre) {
    case 'Administrar':
      eleccionTarea = 'Administrar';
      break;
    case 'Entrenamientos':
      eleccionTarea = 'Entrenamientos';
      break;
    case 'Organizacion':
       eleccionTarea = 'Organizacion';
       break;
    case 'Partidos':
      eleccionTarea = 'Partidos';
      break;
    case 'Plantel':
      eleccionTarea = 'Plantel';
      break;
    case 'Reportes':
      eleccionTarea = 'Reportes';
      break;
    case 'Respaldo':
      eleccionTarea = 'Respaldo';
      break;
    case 'Rivales':
      eleccionTarea = 'Rivales';
      break;
    case 'Sugerir':
      eleccionTarea = 'Sugerir';
      break;
    case '':
      eleccionTarea = 'Botones';
      break;
    default:
      eleccionTarea = 'Botones';
      break;
  }

  return (
      <eleccionTarea />
  );
}
export default ListadoTareas;
